const Footer = () => {
    return (
        <footer className='text-white bg-success py-3 d-flex justify-content-center fixed-bottom '>
            <h6 className=''>Copyright &copy; 2022</h6>
            <a href="/" className=''>About</a>
        </footer>
    )
}

export default Footer;
